/** <nowiki>
 * Lazy loads treasure hunter gems background images
 * See {{THGem}} for example, testing, etc.
 * 
 * @author Cqm
 */

;(function ($) {

    var base64Images = {
        none: 'data:image/png;base64,',
        common: 'data:image/png;base64,',
        'fairly-common': 'data:image/png;base64,',
        uncommon: 'data:image/png;base64,',
        rare: 'data:image/png;base64,',
        'very-rare': 'data:image/png;base64,',
        'ultra-rare': 'data:image/png;base64,'
    };

    function init() {
        var imgClassPrefix = '.THGem-',
            images = Object.keys(base64Images);
        
        images.forEach(function (elem) {
            var selector = imgClassPrefix + elem;
                $img = $(selector);
            
            if ($img.length) {
                $img.css('background-image', 'url(' + base64Images[elem] + ')');
            }
        });
    }
    
    $(init);

}(jQuery));